import React, { Component } from 'react';
import './scss/App.scss';

export class Slide4 extends Component {




  render(){
return(
      <div className="slide4"> 
      <h1 className="headline">YOUR STATS PER GAME</h1>
      <h2>DEFENCE:</h2>
      <div className="statsContainer">
      <div>
        <span>BLOCKS</span>
        <input value={props.blocksVal} type="number" min="0" step="1" onChange={props.getBlocks}></input>
       </div>
      <div>
        <span>REBOUNDS</span>
        <input value={props.reboundsVal} type="number" min="0" step="1" onChange={props.getRebs}></input>
      </div>
     <div>
       <span>STEALS</span>
       <input value={props.stealsVal} type="number" min="0" step="1" onChange={props.getSteals}></input>
      </div> 
     </div>
</div>
    )
  }
}

export default Slide4;
